import React from 'react'
import { useState } from "react";
import LineChart from './components/LineChart'
import { UserData } from './Data'
import './Home.css'



 function Home ()
{

// Weight line graph 
    const [userData, setUserData] = useState({
        labels: UserData.map((data) => data.year),
        datasets: [
          {
            label: "Overall Weight",
            data: UserData.map((data) => data.calories),
            backgroundColor: [
              "rgba(75,192,192,1)", // Color of the line 
            ],
            borderColor: "black",
            borderWidth: 2,
          },
        ],
      });

    return(
      <> 
      Welcome to Bruinfit

         <div style={{ width: 800 }}>

        Overall Weight Change:
        <LineChart chartData={userData} />  </div>
      </>

    );
}

export default Home;
